import React from "react";
import "./Card.scss";

const Card = (props) => {
    const { CardArr } = props;

    const Cards = CardArr.map((card, index) => {
      return (
        <div key={index} className="Card">
          <h2>Name: {card.suit}</h2>
          <h3>Role: {card.value}</h3>
          <p>test</p>
        </div>
      );
    });

    return <div className="Card">{Cards}</div>;
  };

  export default Card;
